\n<p>Last updated: September 26, 2018</p>\n\n<p>AIOCity operates aiocity.com (the &quot;Site&quot;). This page informs you of our policies regarding the collection, use and disclosure of Personal Information we receive from users of the Site.</p>\n\n<p>We use your Personal Information only for providing the necessary services you may require and improving the Site. By using the Site, you agree to the collection and use of information in accordance with this policy.</p>\n\n<p><strong>Information Collection and Use</strong></p>\n\n<p>While using our Site, we may ask you to provide us with certain personally identifiable information that can be used to contact or identify you. Personally identifiable information may include, but is not limited to your name (&quot;Personal Information&quot;).</p>\n\n<p><strong>Log Data</strong></p>\n\n<p>Like many site operators, we collect information that your browser sends whenever you visit our Site (&quot;Log Data&quot;).</p>\n\n<p>This Log Data may include information such as your computer&#39;s Internet Protocol (&quot;IP&quot;) address, browser type, browser version, and the pages of our Site that you visit, the time and date of your visit, the time spent on those pages and other statistics.</p>\n\n<p>In addition, we may use third party services such as _______________ (Analytics) that collect, monitor and analyze this information.</p>\n\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"650\">\n	<tbody>\n		<tr>\n			<td style=\"width:650px;\">\n			<p>The Log Data section is for businesses that use analytics or tracking services in websites or apps, like Google Analytics. For the full disclosure section, pls. visit <a href=\"http://www.aiocity.privacypolicy\">www.aiocity.privacypolicy</a></p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p><strong>Communications</strong></p>\n\n<p>We may use your Personal Information to contact you with newsletters, marketing or promotional materials and other information that you might be interested.&nbsp; Please click the tick box</p>\n\n<p>The Communications section is for businesses that may contact users via email (email newsletters) or other methods. For the full disclosure section, please visit <a href=\"http://www.aiocity.privacypolicy\">www.aiocity.privacypolicy</a>.</p>\n\n<p><b>Cookies</b></p>\n\n<p>Cookies are files with small amount of data, which may include an anonymous unique identifier. Cookies are sent to your browser from a web site and stored on your computer&#39;s hard drive.</p>\n\n<p>Like many sites, we use &quot;cookies&quot; to collect information. You can instruct your browser to refuse all cookies or to indicate when a cookie is being sent. However, if you do not accept cookies, you may not be able to use some portions of our Site.</p>\n\n<p><b>Security</b></p>\n\n<p>The security of your Personal Information is important to us, but remember that no method of transmission over the Internet, or method of electronic storage, is 100% secure. While we strive to use commercially acceptable means to protect your Personal Information, we cannot guarantee its absolute security.</p>\n\n<p><b>Changes To This Privacy Policy</b></p>\n\n<p>This Privacy Policy is effective as of September 26, 2018 and will remain in effect except with respect to any changes in its provisions in the future, which will be in effect immediately after being posted on this page.</p>\n\n<p>We reserve the right to update or change our Privacy Policy at any time and you should check this Privacy Policy periodically. Your continued use of the Service after we post any modifications to the Privacy Policy on this page will constitute your acknowledgment of the modifications and your consent to abide and be bound by the modified Privacy Policy.</p>\n\n<p>If we make any material changes to this Privacy Policy, we will notify you either through the email address you have provided us, or by placing a prominent notice on our website.</p>\n\n<p><b>Contact Us</b></p>\n\n<p>If you have any questions about this Privacy Policy, please contact us.</p>\n</div>","Active","Privacy Policy","<p><strong>Ang patakaran sa privacy na ito ay namamahala sa iyong paggamit ng application software AIO City (&quot;Application&quot;) para sa mga mobile device na nilikha ng Net4Site. Pinapagana ng Application ang isang</strong></p>\n\n<p><strong>Anong impormasyon ang nakuha ng Application at paano ito ginagamit?</strong></p>\n\n<p><strong>Ang seksyon na ito ay dinisenyo upang ipaalam ang Mga Gumagamit ng mga uri ng data na nakuha ng app at kung paano ginagamit ang impormasyong iyon. Makakahanap ka ng maraming uri ng data na kadalasang nakuha ng apps, ngunit dapat mong bigyan ang mga Gumagamit ng isang malinaw, nakapagpapakita na listahan ng mga pinakamahalagang punto ng data na nakuha ng iyong app.</strong></p>\n\n<p><strong>User Provided Information</strong></p>\n\n<p><strong>Kinukuha ng Application ang impormasyon na iyong ibinibigay kapag nag-download ka at nagrerehistro sa Application. Ang pagpaparehistro sa amin ay opsyonal. Gayunpaman, mangyaring tandaan na maaaring hindi mo magagamit ang ilan sa mga tampok na inaalok ng Application maliban kung magrehistro ka sa amin.</strong></p>\n\n<p><strong>Ang alternatibong wika kung hindi mo pinapayagan ang mga hindi rehistradong gumagamit: &quot;Ang pagpaparehistro sa amin ay ipinag-uutos upang magamit ang mga pangunahing tampok ng Application.&quot; (Sa kabilang banda, baka gusto mong tukuyin na hindi mo pinahihintulutan ang user na magparehistro, ngunit ilista pa rin ang impormasyong iyong kinokolekta).</strong></p>\n\n<p><strong>Ang mga developer ng mobile na application ay dapat magkaroon ng kamalayan na ang ilang mga uri ng data, halimbawa, mga medikal na talaan at ilang uri ng impormasyon sa pananalapi ay maaaring napapailalim sa umiiral na batas sa pagkapribado, o anumang iba pang kasalukuyan o hinaharap na estado, pederal na batas, regulasyon, paghihigpit, atbp Mga developer ng Application Ang paglikha ng mga apps na mangolekta ng potensyal na sensitibong impormasyon ay hinihikayat na makakuha ng payo upang matiyak na ang kanilang mga patakaran sa pagkolekta ng data ay nasa linya ng kasalukuyang batas sa (mga) hurisdiksyon kung saan maaaring gamitin ang app. Kung kinokolekta mo ang impormasyon ng credit card, malakas kaming hinihikayat kang humingi ng payo ng isang propesyonal upang matiyak ang pagsunod sa PCI at iba pang partikular na mga kinakailangan sa seguridad.</strong></p>\n\n<p><strong>Kapag nag-rehistro ka sa amin at ginagamit ang Application, sa pangkalahatan ay nagbibigay sa iyo (a) iyong pangalan, email address, edad, pangalan ng user, password at iba pang impormasyon sa pagpaparehistro; (b) impormasyon na may kaugnayan sa transaksyon, tulad ng kapag gumawa ka ng mga pagbili, tumugon sa anumang mga alok, o mag-download o magamit ang mga application mula sa amin; (c) impormasyon na ibinigay mo sa amin kapag nakikipag-ugnay ka sa amin para sa tulong; (d) impormasyon ng credit card para sa pagbili at paggamit ng Application, at; (e) impormasyon na ipinasok mo sa aming system kapag ginagamit ang Application, tulad ng impormasyon ng contact at impormasyon sa pamamahala ng proyekto.</strong></p>\n\n<p><strong>Ang listahan na ito ay hindi komprehensibo. Ayusin ito ayon sa kung ano talaga ang hiniling ng iyong app.</strong></p>\n\n<p><strong>Maaari din naming gamitin ang impormasyong ibinigay mo sa amin upang makipag-ugnay sa iyong paminsan-minsan upang mabigyan ka ng mahalagang impormasyon, kinakailangang mga abiso at mga promo sa marketing.</strong></p>\n\n<p><strong>Awtomatikong Nakolektang Impormasyon</strong></p>\n\n<p><strong>Kung ang Application ay nangongolekta ng impormasyon mula sa at / o para sa mga platform ng social networking (hal., Paghawak ng impormasyon ng contact, mga listahan ng kaibigan, impormasyon sa pag-login, mga larawan o mga check-in) dapat mong matiyak na ang naunang pahintulot ng gumagamit ay nakuha.</strong><br />\n<br />\n&nbsp;</p>\n\n<p><strong>Bilang karagdagan, ang Application ay maaaring mangolekta ng ilang impormasyon awtomatikong, kabilang ang, ngunit hindi limitado sa, ang uri ng mobile device na iyong ginagamit, ang iyong mga mobile device natatanging device ID, ang IP address ng iyong mobile device, ang iyong mobile operating system, ang uri ng mobile Mga browser ng internet na ginagamit mo, at impormasyon tungkol sa paraan ng paggamit mo sa Application.</strong></p>\n\n<p><strong>Muli, ang listahang ito ay hindi komprehensibo. Ayusin ito ayon sa kung ano talaga ang hiniling ng iyong app.</strong></p>\n\n<p><br />\n<strong>Kinokolekta ba ng Application ang tumpak na real time na impormasyon sa lokasyon ng device?<br />\nKung ang iyong app ay gumagamit ng geolocation, tingnan ang tukoy na sangay ng dokumentong ito https://www.docracy.com/6513/mobile-privacy-policy-geolocated-apps-</strong></p>\n\n<p><strong>Ang Application na ito ay hindi mangolekta ng tumpak na impormasyon tungkol sa lokasyon ng iyong mobile device.</strong></p>\n\n<p><strong>Nakikita ba ng mga third party at / o may access sa impormasyon na nakuha ng Application?<br />\nSinasaklaw ng sumusunod na wika ang hindi nakikilalang data na maaaring kolektahin ng mga serbisyo ng analytics ng third-party para sa iyo, at ilang iba pang mga karaniwang kaso kung saan ang pagbabahagi ng data ng mga gumagamit ay makatarungan at makatwiran. Sa pangkalahatan, nais ng mga developer ng app na magkaroon ng karapatang maglipat ng impormasyong nakolekta ng app sa ilalim ng ilang mga pangyayari. Halimbawa, kung ang nagbebenta ng app ay nagbebenta ng app, maaaring gusto ng developer na ang impormasyong nakolekta ng application ay inilipat bilang bahagi ng pagbebenta. Habang ang ilan sa mga mas karaniwang mga halimbawa ng paglipat ng data sa mga ikatlong partido ay ipinagkaloob, hinihikayat kang gumana sa payo at / o propesyonal sa pagkapribado upang matukoy kung ang ibang mga halimbawa ay dapat isama sa patakaran.</strong></p>\n\n<p><strong>Tanging pinagsama-sama, ang hindi nakikilalang data ay pana-panahong nakukuha sa mga panlabas na serbisyo upang matulungan kaming mapabuti ang Application at aming serbisyo. Ibabahagi namin ang iyong impormasyon sa mga third party lamang sa mga paraan na inilarawan sa pahayag sa privacy na ito.</strong></p>\n\n<p><strong>Maaari naming ibunyag ang Ibinigay ng User at Awtomatikong Nakolektang Impormasyon:</strong></p>\n\n<p><strong>tulad ng iniaatas ng batas, tulad ng upang sumunod sa isang subpoena, o katulad na legal na proseso;<br />\nkapag naniniwala kami na may mabuting pananampalataya na kinakailangan ang pagsisiwalat upang maprotektahan ang aming mga karapatan, protektahan ang iyong kaligtasan o ang kaligtasan ng iba, magsiyasat sa pandaraya, o tumugon sa kahilingan ng pamahalaan;<br />\nsa aming mga pinagkakatiwalaang mga tagapagkaloob ng serbisyo na nagtatrabaho para sa amin, walang independiyenteng paggamit ng impormasyong ibinubunyag namin sa kanila, at sumang-ayon na sundin ang mga patakaran na nakalagay sa pahayag sa privacy na ito.<br />\nkung ang Net4Site ay kasangkot sa isang pagsama, pagkuha, o pagbebenta ng lahat o bahagi ng mga asset nito, aabisuhan ka sa pamamagitan ng email at / o isang kilalang abiso sa aming Web site ng anumang pagbabago sa pagmamay-ari o paggamit ng impormasyong ito, pati na rin tulad ng anumang mga pagpipilian na maaaring mayroon ka tungkol sa impormasyong ito.<br />\nKung gumagana ang iyong app sa mga advertiser at mga kumpanya ng analytics na mangolekta ng personal na data, ang iyong patakaran ay kailangang magkaroon ng isang Awtomatikong Data Collection at Advertising section. Tingnan ang partikular na branch dito: https://www.docracy.com/6516/mobile-privacy-policy-ad-sponsored-apps-</strong></p>\n\n<p><strong>Ano ang aking mga karapatan sa pag-opt out?<br />\nKung ang iyong app ay gumagamit ng geolocation o taps sa mga serbisyo sa advertising, suriin ang naaangkop na mga sanga na naka-link sa itaas.</strong></p>\n\n<p><strong>Maaari mong ihinto ang lahat ng koleksyon ng impormasyon sa pamamagitan ng Application sa pamamagitan ng pag-uninstall ng Application. Maaari mong gamitin ang karaniwang mga proseso ng pag-uninstall na magagamit bilang bahagi ng iyong mobile device o sa pamamagitan ng marketplace ng mobile application o network. Maaari ka ring humiling na mag-opt out sa pamamagitan ng email, sa privacy@net4site.com.</strong></p>\n\n<p><strong>Patakaran sa Pagpapanatili ng Data, Pamamahala ng Iyong Impormasyon<br />\nSusuriin namin ang data na ibinigay ng Gumagamit nang hangga&#39;t ginagamit mo ang Application at para sa isang makatwirang oras pagkatapos noon. Ipagpapanatili namin ang Awtomatikong Nakolekta na impormasyon hanggang sa 24 na buwan at pagkatapos ay maaaring mag-imbak ito nang pinagsama-samang. Kung nais mong tanggalin namin ang Data na ibinigay ng User na iyong ibinigay sa pamamagitan ng Application, mangyaring makipag-ugnay sa amin sa privacy@net4site.com at tutugon kami sa isang makatwirang oras. Mangyaring tandaan na ang ilan o lahat ng Data na Ibinigay ng User ay maaaring kinakailangan upang ang Application ay gumana ng maayos.</strong><br />\n<br />\n&nbsp;</p>\n\n<p><strong>Mga bata<br />\nDapat sumunod ang iyong app sa Online Protection Act ng Proteksyon sa Bata (COPPA). Ang mga developer ay dapat magbayad ng partikular na atensyon sa COPPA kapag lumilikha ng mga app na naglalaman ng mga character na cartoon o iba pang mga tampok na maaaring maging sanhi ng ang app na maunawaan bilang itinuro sa mga bata sa ilalim ng 13. Isaalang-alang ang kabilang ang wika sa iyong Mga Tuntunin ng Serbisyo na ginagawang mga gumagamit na kumakatawan sa kanilang edad. Ang mga developer ng application na lumilikha ng apps na maaaring pamamahalaan sa ilalim ng COPPA o mga katulad na batas ay hinihikayat na makakuha ng payo upang matiyak na ang kanilang mga patakaran sa pagkolekta ng data ay nasa linya ng kasalukuyang batas sa (mga) hurisdiksyon kung saan maaaring gamitin ang app.</strong></p>\n\n<p><strong>Hindi namin ginagamit ang Application upang sadyang makuha ang data mula sa o market sa mga bata sa ilalim ng edad na 13. Kung ang isang magulang o tagapag-alaga ay nakaaalam na ang kanyang anak ay nagbigay sa amin ng impormasyon nang walang pahintulot, dapat siya makipag-ugnay sa amin sa privacy @ net4site.com. Tatanggalin namin ang naturang impormasyon mula sa aming mga file sa loob ng makatwirang oras.</strong></p>\n\n<p><br />\n<strong>Seguridad<br />\nDapat tiyakin ng mga developer ng application na ang kanilang mga pamamaraan sa seguridad ay makatwiran, at dapat magbigay ng pangkalahatang ideya ng kanilang mga pamamaraan sa seguridad sa ibaba.</strong></p>\n\n<p><strong>Nababahala kami tungkol sa pagbabantay ng pagiging kompidensyal ng iyong impormasyon. Nagbibigay kami ng pisikal, elektronikong, at pamamaraan na pananggalang upang protektahan ang impormasyong aming pinoproseso at pinapanatili. Halimbawa, nililimitahan namin ang pag-access sa impormasyong ito sa mga awtorisadong empleyado at kontratista na kailangang malaman ang impormasyong iyon upang makapagpatakbo, bumuo o mapabuti ang aming Application. Mangyaring magkaroon ng kamalayan na, bagama&#39;t sinisikap naming magbigay ng makatwirang seguridad para sa impormasyon na aming pinoproseso at pinanatili, walang sistema ng seguridad na maaaring pigilan ang lahat ng mga potensyal na paglabag sa seguridad.</strong></p>\n\n<p><strong>Mga pagbabago<br />\nAng Patakaran sa Pagkapribado na ito ay maaaring ma-update paminsan-minsan sa anumang dahilan. Ipapaalam namin sa iyo ang anumang mga pagbabago sa aming Patakaran sa Pagkapribado sa pamamagitan ng pag-post ng bagong Patakaran sa Pagkapribado dito at pagpapabatid sa iyo sa pamamagitan ng email o text message. Ikaw ay pinapayuhan na kumonsulta sa Patakaran sa Privacy na ito nang regular para sa anumang mga pagbabago, tulad ng patuloy na paggamit ay itinuturing na apruba ng lahat ng mga pagbabago.</strong></p>\n\n<p><strong>Ang iyong Pahintulot<br />\nSa pamamagitan ng paggamit ng Application, sinasang-ayunan mo ang aming pagproseso ng iyong impormasyon tulad ng itinakda sa Patakaran sa Pagkapribado na ito at bilang susugan sa amin. Ang &quot;pagproseso,&quot; ay nangangahulugang paggamit ng mga cookies sa isang computer / hand held device o paggamit o paghawak ng impormasyon sa anumang paraan, kabilang ang, ngunit hindi limitado sa, pagkolekta, pag-iimbak, pagtanggal, paggamit, pagsasama at pagsisiwalat ng impormasyon, lahat ng aktibidad ay magaganap sa Estados Unidos Kung ikaw ay naninirahan sa labas ng Estados Unidos ang iyong impormasyon ay ililipat, maiproseso at naka-imbak doon sa ilalim ng mga pamantayan sa privacy ng Estados Unidos.</strong></p>\n\n<p><strong>Makipag-ugnayan sa amin<br />\nKung mayroon kang anumang mga katanungan tungkol sa privacy habang ginagamit ang Application, o may mga katanungan tungkol sa aming mga kasanayan, mangyaring makipag-ugnay sa amin sa pamamagitan ng email sa privacy@net4site.com.</strong></p>");
